import React from 'react';
import './dentries.css';
import Axios from "axios";

function Dentries()
{
    const [formData, setFormData] = useState({
        district: '',
        stream: '',
        zValue1: '',
         zValue2: ''
      });
      const [users, setusers] = useState({
        district: '',
        stream: '',
        zValue1: '',
         zValue2: ''
      });
      const handleinput = (event) =>{
        setFormData(event.target.value);

      };

      const handleSubmit =( event)=>
      {
        const newdata ={id : Date.now(), district : formData.district, stream : formData.stream,
          zValue1 : formData.zValue1, zValue2 : formData.zValue2
        };
        setusers([...users,newdata]);
        addData(newdata);

      }

      const addData = (user) =>
      {
        Axios.post("http://localhost:3002/enter",user)
        .then((Response) =>
        {
          console.log("user add");
        })
      }
    return (
        
         <div className="form-container">
          <form onChange={handleSubmit}>
          <h2 className="form-title">Submit Your Information</h2>
    
          <div className="form-group">
            <label htmlFor="district">Enter District</label>
            <input onChange={handleinput} value={formData.Dentries} type="text" id="district" className="input-box" placeholder="Enter district" />
          </div>
    
          <div className="form-group">
            <label htmlFor="stream">Enter Stream</label>
            <input onChange={handleinput} value={formData.stream} type="text" id="stream" className="input-box" placeholder="Enter stream" />
          </div>
    
          <div className="form-group z-range-group">
            <label>Enter Z-range</label>
            <div className="z-range-inputs">
              <input onChange={handleinput} type="text" value={formData.zValue1} className="z-range-box"  />
              <input onChange={handleinput} type="text" value={formData.zValue1} className="z-range-box"  />
            </div>
            </div>
        <div className='box3'>
        <button className="submit-button">Submit</button>
        </div>
          </form>
        </div>

       
    );
}

export default Dentries;
